import styled from 'styled-components'
const Sidebar = () => {
    return (
        <Wrapper>
            <Heading>Huda</Heading>
        </Wrapper>
    )
}
const Wrapper = styled.aside`
background-color:#F6F7FB;
padding-top:23px;
padding-left:25px;
width:165px;
height:100vh;
`
const Heading = styled.h1`
font-size:32px;


`
export default Sidebar;
